import express from 'express';

const app = express();
const PORT = process.env.PORT || 8080;

app.get('/', (req, res) => {
    res.send("Bonjour depuis index.js");
});

app.listen(PORT, () => {
    console.log(`Serveur en écoute sur le port ${PORT}`);
});

